const Login = () => {
	return (
		<div className="maincontainer">
		  <div className="card">
		    <div className="front">
				<h1>Front of Card</h1><p>This is the front of the card</p>
			</div>
			 <div className="back">
				<h1>Back of Card</h1><p>This is the back of the card</p>
			</div>
		  </div>
        </div>		  
	);
}

export default Login;
